import React from 'react';
import './Card.css';

function Card(props) {
  return (
    <div className="card">
      <img className="card__image" src={props.image} alt={props.title} />
      <div className="card__body">
        <h2 className="card__title">{props.title}</h2>
        <p className="card__rating">{props.rating}/5</p>
      </div>
    </div>
  );
}

export default Card;
